import { Grid } from "@mui/material";
import * as React from 'react';
import savingsLogo from "../../img/savings.svg";

function Home() {
  return (
    <Grid
      container
      justifyContent="center"
      alignItems="center"
      style={{ minHeight: '100vh' }}
    >
      <Grid item>
        <img
          src={savingsLogo}
          style={{
            width: '50%',
            margin: '0 auto'
          }}
          alt="Savings Logo"
        />
      </Grid>
    </Grid>
  );
}

export default Home;
